window.bookSummaryJSON = "<p>Under secret orders to assassinate the Widow, Hawkeye, the rough-edged marksman, finds himself caught up in a violent prison break that releases some of the world's most vicious and powerful criminals. Defying his superiors, Hawkeye joins forces with the sultry Russian spy and a mismatched group of personalities that include Spider-Man, Spider-Woman, Luke Cage, Captain America, and Iron Man. </p> <p>Unexpected betrayals and shocking revelations lead the team from Manhattan's top security Raft prison to the untamed jungle of the Savage Land in this thrilling novel. </p> <p>This GraphicAudioÂ® Production is adapted from the graphic novel by Brian Michael Bendis. </p>"; 
